import React from 'react'

export default function Bounty(props) {
    const {firstName, lastName, bountyAmount, type} = props
    return (
        <div className='bounty'>
            <h1>{firstName} {lastName}</h1>
            <p>bounty: ${bountyAmount}</p>
            <p>type: {type}</p>
        </div>
    )
}
